import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Iban() {
  const banks = [
    // Your bank data here
  ];
  const [iban, setIban] = useState('');
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  const validateIBAN = (iban) => {
    if (!iban) return 'IBAN cannot be empty';

    iban = iban.trim();

    if (iban.length !== 24) return 'IBAN must be 24 characters long';
    if (!iban.startsWith('SA')) return 'IBAN must start with "SA"';

    return '';
  };

  const getBankByIban = (event) => {
    event.preventDefault();
    const errorMessage = validateIBAN(iban);
    if (errorMessage) {
      setError(errorMessage);
      setMessage('');
    } else {
      const BankCode = iban.substring(4, 6);
      const bank = banks.find((b) => b.samaCode === BankCode);
      if (bank) {
        setMessage(
          <div>
            <p className='fs-4'>Your IBAN is correct: {bank.nameAr}</p>
            <img src={bank.img} alt={bank.nameEn} style={{ width: '250px', height: 'auto' }} />
          </div>
        );
        setError('');
      } else {
        setError('Bank not found');
        setMessage('');
      }
    }
  };

  useEffect(() => {
    const isDarkMode = localStorage.getItem('darkMode') === 'true';
    if (isDarkMode) {
      document.documentElement.classList.add('dark-mode');
    } else {
      document.documentElement.classList.remove('dark-mode');
    }
  }, []);

  const toggleDarkMode = () => {
    const isDarkMode = !document.documentElement.classList.contains('dark-mode');
    localStorage.setItem('darkMode', isDarkMode);
    if (isDarkMode) {
      document.documentElement.classList.add('dark-mode');
    } else {
      document.documentElement.classList.remove('dark-mode');
    }
  };

  return (
    <div className="center" data-theme="dark">
      <div className="container mt-5">
        <div className="row">
          <div className="col-md-6 offset-md-3">
            <div className="card shadow-lg p-3 mb-5 bg-body rounded effect6">
              <h1>IBAN Checker</h1>
              <hr className='border border-success border-3 opacity-75' />
              <div className="card-body">
                <form onSubmit={getBankByIban}>
                  <div className="form-group">
                    <label htmlFor="iban" className='badge bg-success fs-6 mb-2'>IBAN:</label>
                    <input
                      type="text"
                      name="iban"
                      id="iban"
                      className={`form-control border-4 ${error ? 'border-danger' : 'border-secondary'}`}
                      value={iban}
                      onChange={(e) => setIban(e.target.value)}
                      placeholder="Enter IBAN"
                    />
                    {error && <h4 className="text-danger">{error}</h4>}
                  </div>
                  <div className="form-group">
                    <button type="submit" className="btn btn-primary mt-2">Submit</button>
                    <button type="reset" className="btn btn-danger mt-2 mx-3" onClick={() => { setIban(''); setError(''); setMessage(''); }}>Reset</button>
                    <button type="button" className="btn btn-dark mt-2" onClick={toggleDarkMode}>Toggle Dark Mode</button>
                  </div>
                </form>
                <div id="result" className="mt-3">
                  {message}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
